import {ProductItem} from "./productItem";

export const ProductList = (props) => {
    const { data } = props;
    return (
        <div>{data.map(item => {
            return <ProductItem key={item.id} product_name={item.product_name} characteristics={item.characteristics}></ProductItem>
        })}
        </div>
    );
}

export default ProductList
